          id: 434
          language_code: fin
          lineage_source: ISO 19107:2003(E)
          lineage_source_similarity: 1
          notes:
          - Koska geometrisen kompleksin ja topologisen kompleksin määritelmät edellyttävät
            ainoastaan, että ne ovat suljettuja rajausoperaatioissa, tietyn ulottuvuuden
            ja sitä alempien ulottuvuuksien primitiivien joukko on aina alkuperäisen,
            laajemman kompleksin alikompleksi. Näin ollen mikä hyvänsä tasomainen
            topologinen aluekompleksi (full planar topological complex) sisältää linkki-solmupiste-verkon
            alikompleksina.
